    function zoomSVG(scaleFactor) {
       const viewBoxValues = svgLadder.getAttribute('viewBox').split(' ');
       const viewBoxWidth = parseFloat(viewBoxValues[2]);
       const viewBoxHeight = parseFloat(viewBoxValues[3]);
   
       newViewBoxWidth = viewBoxWidth * scaleFactor;
       newViewBoxHeight = viewBoxHeight * scaleFactor;
   
       const deltaX = (newViewBoxWidth - viewBoxWidth) / 2;
       const deltaY = (newViewBoxHeight - viewBoxHeight) / 2;
   
       viewBoxX -= deltaX;
       viewBoxY -= deltaY;
   
       totalScaleFactor *= scaleFactor;
   
       svgLadder.setAttribute('viewBox', viewBoxX + ' ' + viewBoxY + ' ' + newViewBoxWidth + ' ' + newViewBoxHeight);
   }

   
