            function createGeneral(name, description) {
                let econtainer = document.getElementById("home-tab-pane");
                econtainer.innerHTML = "";
                let rowDiv = document.createElement("div");
                let colDiv = document.createElement("div");
                let nameInput = document.createElement("input");
                rowDiv.className = "row";
                colDiv.className = "col align-self-start";
                colDiv.innerHTML = "Name: "
                nameInput.type = "text";
                nameInput.className = "form-control form-control-sm";
                nameInput.id = "slaveNameInput"
                nameInput.value = name;
                nameInput.onchange = function () {
                    editorStartTree(name, nameInput.value);
                    vscode.postMessage({
                        command: 'slaveNameChange',
                        value: nameInput.value
                    })
                }
    
                colDiv.appendChild(nameInput);
                rowDiv.appendChild(colDiv);
                econtainer.appendChild(rowDiv);
    
                let rowDiv1 = document.createElement("div");
                let colDiv1 = document.createElement("div");
                let deInput = document.createElement("textarea");
                rowDiv1.className = "row";
                colDiv1.className = "col align-self-start";
                colDiv1.innerHTML = "Description: "
                deInput.className = "form-control form-control-sm"
                deInput.value = description;
                deInput.readOnly = "true";
    
                colDiv1.appendChild(deInput);
                rowDiv1.appendChild(colDiv1);
    
                colDiv.appendChild(nameInput);
                rowDiv.appendChild(colDiv);
    
                econtainer.appendChild(rowDiv);
                econtainer.appendChild(rowDiv1);
            }
    
            function editorStartTree(beforeName, changeName) {
                let slaves = document.getElementsByClassName("subDirveName");
                for (let i = 0; i < slaves.length; i++) {
                    if (beforeName == slaves[i].innerHTML) {
                        slaves[i].innerHTML = changeName;
                    }
                }
            }
    
            function getSideBar(item) {
                let sideItem = document.getElementById("configList");
                let general = document.getElementById("btnGeneral");
                sideItem.innerHTML = "";
                for (let i = 0; i < item.length; i++) {
                    let li = document.createElement("li");
                    let div = document.createElement("div");
                    let span= document.createElement("span");
                    let addSpan= document.createElement("span");
                    li.style.position="relative";
                    li.value = i;

                    addSpan.className = "addIO";
                    addSpan.innerHTML = "+";
                    addSpan.title ="Add IO";

                    span.className="deleteSlaveSpan";
                    span.innerHTML = "\u2013";
                    span.title ="Delete Slave";

                    

                    div.onclick = function () {
                        // tabs default click
                        general.click();
                        vscode.postMessage({
                            command: 'slaveOnclick',
                            value: item[i].slaveName
                        })
                    }

                    span.onclick = function() {
                        deleteSlave(item[i].slaveName);
                    }

                    if (item[i].slaveType == "Coupler") {
                        li.appendChild(addSpan);
                    }

                    addSpan.onclick = function() {
                        AddIOBox();
                    }

                    if (item[i].slaveType == "IO") {
                        li.style.paddingLeft = "20px";
                    }
                    div.innerHTML = item[i].slaveName + " ( " + item[i].slaveType + " )";
                    li.appendChild(span);
                    li.appendChild(div);
                    sideItem.appendChild(li);
                }
            }
    
            function createSyncTable(items) {
                let table = document.getElementById("SyncManager");
                let assTXUl = document.getElementById("PDOAssTX");
                let assRXUl = document.getElementById("PDOAssRX");
                table.innerHTML = "";
                let inputSize = 0;
                let outputSize = 0;
    
                for (let i = 0; i < items.length; i++) {
                    if (items[i].inOut == "Input") {
                        inputSize += parseInt(items[i].Size);
                    }
                    if (items[i].inOut == "Output") {
                        outputSize += parseInt(items[i].Size);
                    }
                }
                let tr1 = document.createElement("tr");
                let tdSm1 = document.createElement("td");
                let tdSize1 = document.createElement("td");
                let tdType1 = document.createElement("td");
                tdSm1.innerHTML = "3";
                tdSize1.innerHTML = inputSize.toFixed(2);
                tdType1.innerHTML = "Input";
                tr1.Type = "Input";
                tr1.id = "Input";
    
                tr1.appendChild(tdSm1);
                tr1.appendChild(tdSize1);
                tr1.appendChild(tdType1);
                tr1.className = "table-active";
                tr1.onclick = function () {
                    assTXUl.style.display = "block";
                    assRXUl.style.display = "none";
                    this.className = "table-active";
                    tr2.className = "";
                }
    
                let tr2 = document.createElement("tr");
                let tdSm2 = document.createElement("td");
                let tdSize2 = document.createElement("td");
                let tdType2 = document.createElement("td");
    
                tdSm2.innerHTML = "0";
                tdSize2.innerHTML = outputSize.toFixed(2);
                tdType2.innerHTML = "Output";
                tr2.Type = "Output";
                tr2.id = "Output";
    
                tr2.appendChild(tdSm2);
                tr2.appendChild(tdSize2);
                tr2.appendChild(tdType2);
                tr2.onclick = function () {
                    assTXUl.style.display = "none";
                    assRXUl.style.display = "block";
                    this.className = "table-active";
                    tr1.className = "";
                }
                table.appendChild(tr1);
                table.appendChild(tr2);
            }
    
            function createPDOAss(items) {
                let assTXUl = document.getElementById("PDOAssTX");
                let assRXUl = document.getElementById("PDOAssRX");
                assTXUl.innerHTML = "";
                assRXUl.innerHTML = "";
                for (let i = 0; i < items.length; i++) {
                    if (items[i].inOut == "Input") {
                        assRXUl.style.display = "none";
                        let tr = document.createElement("tr");
                        let td = document.createElement("td");
                        let input = document.createElement("input");
                        let label = document.createElement("label");
                        input.type = "radio";
                        input.className = "form-check-input me-1";
                        input.name = "InputRadio";
                        input.id = items[i].Index;
                        input.value = items[i].Index;
                        input.onclick = function () {
                            vscode.postMessage({
                                command: 'pdoAssSet',
                                type: "input",
                                value: items[i].Index
                            })
                        }
                        label.className = "form-check-label";
                        label.for = items[i];
                        label.innerHTML = items[i].Index;
                        if (items[i].Fixed == "1") {
                            input.checked = true;
                        }
                        td.appendChild(input);
                        td.appendChild(label);
                        tr.appendChild(td);
                        assTXUl.appendChild(tr);
                    }
                    if (items[i].inOut == "Output") {
                        let tr = document.createElement("tr");
                        let td = document.createElement("td");
                        let input = document.createElement("input");
                        let label = document.createElement("label");
                        input.type = "radio";
                        input.className = "form-check-input me-1";
                        input.name = "OutputRadio";
                        input.id = items[i].Index;
                        input.value = items[i].Index;
                        input.onclick = function () {
                            vscode.postMessage({
                                command: 'pdoAssSet',
                                type: "output",
                                value: items[i].Index
                            })
                        }
                        label.className = "form-check-label";
                        label.for = items[i];
                        label.innerHTML = items[i].Index;
                        if (items[i].Fixed == "1") {
                            input.checked = true;
                        }
                        td.appendChild(input);
                        td.appendChild(label);
                        tr.appendChild(td);
                        assRXUl.appendChild(tr);
                    }
                }
            }
    
            function createPODMappingTable(items) {
                let pdoList = document.getElementById("PDOList");
                pdoList.innerHTML = "";
                for (let i = 0; i < items.length; i++) {
                    let tr = document.createElement("tr");
                    let tdIndex = document.createElement("td");
                    tdIndex.innerHTML = items[i].Index;
                    let tdSize = document.createElement("td");
                    tdSize.innerHTML = items[i].Size;
                    let tdName = document.createElement("td");
                    tdName.innerHTML = items[i].Name;
                    let tdSM = document.createElement("td");
                    tdSM.innerHTML = items[i].SM;
                    tr.appendChild(tdIndex);
                    tr.appendChild(tdSize)
                    tr.appendChild(tdName)
                    tr.appendChild(tdSM)
                    tr.onclick = function () {
                        let trs = pdoList.getElementsByTagName("tr");
                        for (let i = 0; i < trs.length; i++) {
                            if (tr == trs[i]) {
                                trs[i].className = "table-active";
                            } else {
                                trs[i].className = "";
                            }
                        }
                        vscode.postMessage({
                            command: 'pdoMappingClick',
                            value: items[i].Index
                        })
                    }
                    pdoList.appendChild(tr);
                }
            }
    
            function createPDOContent(value, items) {
                let pdoContentDiv = document.getElementById("pdoContent");
                pdoContentDiv.innerHTML = "";
                let title = document.createElement("p");
                title.className = "h6";
                title.innerHTML = "PDO Content: ";
                let span = document.createElement("span");
                span.id = "pdoConSpan";
                span.innerHTML = value;
                title.appendChild(span);
                let table = document.createElement("table");
                table.className = "table table-dark table-hover";
                let thead = document.createElement("thead");
    
                let tr1 = document.createElement("tr");
    
                let thIndex = document.createElement("th");
                thIndex.scope = "col";
                thIndex.innerHTML = "Index";
    
                let thSize = document.createElement("th");
                thSize.scope = "col";
                thSize.innerHTML = "Size";
    
                let thOffs = document.createElement("th");
                thOffs.scope = "col";
                thOffs.innerHTML = "Offs";
    
                let thName = document.createElement("th");
                thName.scope = "col";
                thName.innerHTML = "Name";
    
                let thOType = document.createElement("th");
                thOType.scope = "col";
                thOType.innerHTML = "Type";
    
                tr1.appendChild(thIndex);
                tr1.appendChild(thSize);
                tr1.appendChild(thOffs);
                tr1.appendChild(thName);
                tr1.appendChild(thOType);
                thead.appendChild(tr1);
    
                let tbody = document.createElement("tbody");
                for (let i = 0; i < items.length; i++) {
                    let tr = document.createElement("tr");
                    let tdIndex = document.createElement("td");
                    let tdSize = document.createElement("td");
                    let tdOffs = document.createElement("td");
                    let tdName = document.createElement("td");
                    let tdType = document.createElement("td");
                    tdIndex.innerHTML = items[i].Type + ":" + items[i].SubIndex;
                    tdSize.innerHTML = items[i].Size;
                    tdOffs.innerHTML = items[i].Offs;
                    tdName.innerHTML = items[i].Name;
                    tdType.innerHTML = items[i].DataType;
                    tr.appendChild(tdIndex);
                    tr.appendChild(tdSize);
                    tr.appendChild(tdOffs);
                    tr.appendChild(tdName);
                    tr.appendChild(tdType);
                    tbody.appendChild(tr);
                }
                table.appendChild(thead);
                table.appendChild(tbody);
                pdoContentDiv.appendChild(title);
                pdoContentDiv.appendChild(table);
            }
    
            function createStartUp(items) {
                let startupList = document.getElementById("StartupList");
                startupList.innerHTML = "";
                for (let i = 0; i < items.length; i++) {
                    let tr = document.createElement("tr");
                    let tdTransition = document.createElement("td");
                    tdTransition.innerHTML = items[i].Transiton;
    
                    let tdProtocol = document.createElement("td");
                    tdProtocol.innerHTML = items[i].Protocol;
    
                    let tdIndex = document.createElement("td");
                    tdIndex.innerHTML = items[i].Index;
    
                    let tdData = document.createElement("td");
                    tdData.innerHTML = items[i].Data;
    
                    let tdComment = document.createElement("td");
                    tdComment.innerHTML = items[i].Comment;
                    tr.appendChild(tdTransition);
                    tr.appendChild(tdProtocol);
                    tr.appendChild(tdIndex);
                    tr.appendChild(tdData);
                    tr.appendChild(tdComment);
                    startupList.appendChild(tr);
                }
            }
    
    
            function createNewStart(items) {
                let newStartupList = document.getElementById("NewStartUpList");
                newStartupList.innerHTML = "";
                for (let i = 0; i < items.length; i++) {
                    let tr = document.createElement("tr");
                    let tdTransition = document.createElement("td");
                    tdTransition.innerHTML = items[i].Transiton;
    
                    let tdProtocol = document.createElement("td");
                    tdProtocol.innerHTML = items[i].Protocol;
    
                    let tdIndex = document.createElement("td");
                    tdIndex.innerHTML = items[i].Index + " : " + items[i].SubIndex;
    
                    let tdData = document.createElement("td");
                    tdData.innerHTML = items[i].Data;
    
                    let tdComment = document.createElement("td");
                    tdComment.innerHTML = items[i].Comment;
                    tr.appendChild(tdTransition);
                    tr.appendChild(tdProtocol);
                    tr.appendChild(tdIndex);
                    tr.appendChild(tdData);
                    tr.appendChild(tdComment);
                    tr.id = i;
    
                    tr.onclick = function () {
                        let trs = newStartupList.getElementsByTagName("tr");
                        for (let i = 0; i < trs.length; i++) {
                            if (tr == trs[i]) {
                                trs[i].className = "table-active";
                            } else {
                                trs[i].className = "";
                            }
                        }
                    }
    
                    newStartupList.appendChild(tr);
                }
    
            }
            function generalClick() {
                vscode.postMessage({
                    command: 'generalClick'
                })
            }
    
            function addStartUp() {
                let startBox = document.getElementById("startupbox");
                startBox.style.display = "block";
    
            }
    
            function startUpOK() {
                let startBox = document.getElementById("startupbox");
                startBox.style.display = "none";
    
                let startTransition = document.getElementsByName("transitionCheckbox");
                let startIndex = document.getElementById("startIndex").value;
                let startSubIndex = document.getElementById("startSubIndex").value;
                let startData = document.getElementById("startData").value;
                let startComment = document.getElementById("startComment").value;
    
                let Trsparm = [];
    
                for (let i = 0; i < startTransition.length; i++) {
                    if (startTransition[i].checked == true) {
                        Trsparm.push(startTransition[i].value);
                    }
                }
    
                vscode.postMessage({
                    command: 'newStartUp',
                    transition: Trsparm,
                    index: startIndex,
                    subIndex: startSubIndex,
                    data: startData,
                    comment: startComment
                })
            }
    
            function startUpCancel() {
                let startBox = document.getElementById("startupbox");
                startBox.style.display = "none";
            }
    
            function moveUp() {
                let newstartTable = document.getElementById("NewStartUpList");
                let startChecked = newstartTable.getElementsByClassName("table-active");
                vscode.postMessage({
                    command: 'moveUp',
                    upIndex: startChecked[0].id
                })
            }
    
            function moveDown() {
                let newstartTable = document.getElementById("NewStartUpList");
                let startChecked = newstartTable.getElementsByClassName("table-active");
                vscode.postMessage({
                    command: 'moveDown',
                    downIndex: startChecked[0].id
                })
            }
    
            function startUpDelete() {
                let newstartTable = document.getElementById("NewStartUpList");
                let startChecked = newstartTable.getElementsByClassName("table-active");
    
                vscode.postMessage({
                    command: 'startDelete',
                    deleteIndex: startChecked[0].id
                })
            }
    
